import React, { useState } from 'react';
import Navbar from './navbar';
import Options from './Options';

const Body = () => {
	const [stuffs, setCount] = 
   useState([
      {id:0, value: ""}, 
      {id:1, value: ""}, 
      {id:2, value: ""}
   ]);
		return(
			<div>
				<Navbar/>
				{stuffs.map( stuff => 
          <Options 
            key={stuff.id} 
            value={stuff.value}
          />
            )}
			</div>
		);
}

export default Body;
